import React from "react";

const Car = ({ car, onDelete }) => {
  const handleDelete = () => {
    // Call the onDelete function with the car id
    onDelete(car.id);
  };

  return (
    <tr>
      <td>{car.name}</td>
      <td>{car.model}</td>
      <td>{car.type}</td>
      <td>
        <div className="btn-group" role="group" aria-label="Basic example">
          <button className="btn btn-warning xs" onClick={() => {/* Add the logic for update */}}>
            <svg xmlns="http://www.w3.org/2000/svg" height="16" width="16" viewBox="0 0 512 512">
              {/* SVG path for update icon */}
            </svg>
          </button>
          <button className="btn btn-danger xs" onClick={handleDelete}>
            <svg xmlns="http://www.w3.org/2000/svg" height="16" width="14" viewBox="0 0 448 512">
              {/* SVG path for delete icon */}
            </svg>
          </button>
        </div>
      </td>
    </tr>
  );
};

export default Car;
